/* RETARDER L'ACTIVATION DE NOTRE CODE */
$(function(){
    // attendre que le DOM soit pret
    // pour activer cette fonction

    // selectionner les balises et agir dessus...
    $("h1").on("click", function(){
        // cette fonction sera appele quand le visiteur
        // va cliquer sur la balise h1
        alert('CLICK');        
    });
});
